%[text] # テスト
%[text] ## 初期値
a=1;
vl=VirtualLink;
%[text] ##  テスト
%% test1
a=a+1;
assert(a==2);
%[text] test2は連続的に実行すると失敗するが，独立に実施すると通る．
%% test2
a=a+2;
assert(a==3); %[output:5d45cc92]
%%
%[text] ## Disk of spine
%% abalone disk
vl.setData(GaussCode={[1,-1]},orientation=1)
tbl=vl.getDiskTable; %[output:14f1ccd7]
weight=-(tbl.delta\tbl.cp)'
%%

%% negative abalone disk 
vl.setData(GaussCode={[1,-1]},orientation=-1)
tbl=vl.getDiskTable;
weight=-(tbl.delta\tbl.cp)'
%%

%% abalone knot compl
vl.setData(GaussCode={[1,-1]},orientation=1)
vl.convertKnotCompl;
tbl=vl.getDiskTable;
weight=-(tbl.delta\tbl.cp)' %[output:42e04107] %[output:9c2754d9]
tbl.delta*weight'+tbl.cp %[output:3c754ea0]
dx=tbl.delta;
dx=dx(:,[1,3,5,7]) %[output:46beeff3]
dx*[0;1;1;-1]+tbl.cp %[output:7a636727]
%%
%% abalone knot complement and add loop
vl.setData(GaussCode={[1,-1]},orientation=1)
vl.convertKnotCompl;
[gc,ori]=vl.getGaussCode;
gc{1}(end+1)=-5;
gc{3}=[5];
ori(end+1)=1;
vl.setData(GaussCode=gc,orientation=ori)
% tbl=vl.getDiskTable;
vl.calcWeight %[output:9ca9319a] %[output:50f098b7]
%%
%% plot abalone
vl.setData(GaussCode={[1,-1]},orientation=1)
vl.plot %[output:920db7e9] %[output:6aae12d2]
%%
vl.setData(GaussCode={[1,-1,-3,3,-2,2]},orientation=[-1,0,1]) %[output:5e4dbfbf]
vl.plot
pd=vl.getPDCode
[gc,ori]=vl.getVirtualGaussCode
vl.getVirtualPDCode
vl.setData(PDCode=pd+1)
[gc,ori]=vl.getGaussCode
vl.plot

%%
%% from table
vl.setData(table=[7,4])
vl.plot %[output:26c5d10a] %[output:878d2795]
close all
%%
%% plot Virtual Link
vl.setData(Gauss={[1,3,-3,-2],[-1,2]},ori=[1,0,1])
vl.plot(virtual=false,bendingNumbers={[1,2,-3,0,3,1]}) %[output:12a96a4c] %[output:7df059d2]
%%
%[text] ## plot weighted virtual link
vl=VirtualLink %[output:61079f19]
vl.setData(RGauss={[1,2,-2],[-1]},ori=[1,1])
vl.calcVG2G %[output:52e8e815]
vl.plot
vl.setData(RGauss={[1,2,-2],[-1]},ori=[1,1])
vl.plot
%%
%% plot Lens space 2 1
vl.setData(GaussCode={[1,-3,2,-2,3,-1]},orientation=[1,1,0])
vl.setWeight([0,1,-1,-1])
vl.plot(virtual=false,bendingNumbers={[3,-1,1,-3,1,-1]}) %[output:9da100f2] %[output:7240d131]
vl.plot(bendingNumbers={[3,-1,1,-3,1,-1]}) %[output:74dd7d8d] %[output:5581e5f9]
%%
%% plot abalone with weight
vl.setData(GaussCode={[1,-1]},orientation=1)
vl.setWeight([1,-2])
vl.plot %[output:397d848f] %[output:35f2d0f9]
%%
%% calc weight of L 2 1
vl.setData(GaussCode={[1,-3,2,-2,3,-1]},orientation=[1,1,0])
vl.calcWeight %[output:8f3f3e7f] %[output:57b7b5aa]
vl.getMatrixHMove' %[output:7c00c013]
%%
vl.setData(GaussCode={[1,-1]},orientation=1)
vl.convertKnotCompl
vl %[output:066ed1ef]
vl.plot(virtual=false) %[output:6cf1a591] %[output:5a49a02b]
vl.calcWeight %[output:7f229199] %[output:70cf57fd]
%%
vl=VirtualLink %[output:2e20b933]
vl.setData(RG={[1,2,-2,-3,-5],[-4,-1,3,4],[5]},ori=[-1,1,-1,1,1])
vl.plot %[output:7bfcb3ad] %[output:876c7e4c]
[wei,z,v]=vl.calcWeight; %[output:6b94166f]
vl.setWeight(v(1,:));
vl.plot %[output:40eac2be] %[output:31851766]
%%


